      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN col0 * + CAST ( NULL AS INTEGER ) * + + col1 AND + + col1 / col2 - - + col0 * - - ( - col1 );
  - name: tab0

outputs:
  - name: q10132.out
    data: |
